, akan dilakukan penyempurnaan penyusunan dashboard pemantauan RPJMN. Kemudian akan dilakukan kunjungan lapangan ke daerah yang menjadi lokus pemantauan untuk mempertajam analisis. ', `outcome` = '5. Penyusunan Laporan Akhir\r\nLaporan akhir kegiatan berisi analisis deskriptif dari data pencapaian indikator target pembangunan wilayah RPJMN 2020-2024 di 34 provinsi, serta keterkaitan perencanaan pembangunan nasional dengan provinsi.', `tag` = Array, `up_dt` = '2023-12-21 22:01:22', `up_by` = 'testpapuabar'
